import React from "react";
import DonutChart from 'react-donut-chart';

export default function Pie() {

    return (
        <div>
            <DonutChart
              width="1000" 
              height="1000"
              data={[{
                label: 'Give you up',
                value: 25
              },
              {
                label: '',
                value: 75,
                isEmpty: true
                }]} />
        </div>
    );
  }
